import React, { useState, useEffect } from "react";
import axios from "axios";

function ReportButton() {
  //const [data, setData] = useState({}); // data bir nesne olarak başlatıldı.
  const [key, setKey] = useState({});
  const [value, setValue] = useState({});

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get("http://localhost:3000/report-page");
        setKey(Object.keys(response.data[0]));
        setValue(Object.values(response.data[0])); // BUG İLK  OBJE GELİYOR SADECE
        console.log(response);
      } catch (error) {
        console.error("Error fetching data", error);
      }
    };
    fetchData();
  }, []);

  const handleClick = () => {
    console.log(key);
    console.log(value);
  };

  return (
    <div>
      <table>
        <button onClick={handleClick}>Report</button>
      </table>
    </div>
  );
}

export default ReportButton;

